import React from 'react';
import {Router, Switch, Route, Link} from 'react-dom'


function Navbar(){
    return (
        <Router>
            <div>
                <ul>
                    <li>
                        <Link to="Weather.js">Weather</Link>
                    </li>
                    <li>
                        <Link to="Fiveday.js">5 Day Forecast</Link>
                    </li>
                </ul>
            </div>
        </Router>

    )
}
export default Navbar;
